import React from 'react';

export default props =>{
    const workQuestions = './json/jsonMessages1.json';
    const communication = './json/jsonMessages2.json';
    return (
        <div style={{display:'flex', justifyContent:'center', padding: '50px 0'}}>
            <button onClick={()=>props.onSelect(workQuestions)} className="btn btn-success">Рабочие вопросы</button>
            <button onClick={()=>props.onSelect(communication)} className="btn btn-danger">Общение</button>
        </div>
    )
}
